import React from 'react';
import Itens from './Itens';
import Paginacao from './Paginacao'




const Listavideos = ({videos, onVideoSelect, nextPageToken, previousPageToken, onNextPage, onPreviousPage}) => {

			
		const listaDeVideos = videos.map(  (video, id) => <Itens onVideoSelect={onVideoSelect} key={id} video={video} /> )
			return(
				<div >
					<ul>
						{listaDeVideos}
					</ul>
					{videos === undefined ? (null): (<Paginacao nextPageToken={nextPageToken} previousPageToken={previousPageToken} onNextPage={onNextPage} onPreviousPage={onPreviousPage} />)}
						
					
					
				</div>
				) 

	};	
	
		


export default Listavideos;
